import React from 'react';
import LegalDashboard from './components/LegalDashboard';

const Legal = ({ activeSubTab, onSubTabChange }) => {
  const renderContent = () => {
    switch (activeSubTab) {
      case 'documents':
        return <LegalDashboard activeTab="documents" />;
      case 'compliance':
        return <LegalDashboard activeTab="compliance" />;
      case 'regulatory':
        return <LegalDashboard activeTab="regulatory" />;
      default:
        return <LegalDashboard activeTab="documents" />;
    }
  };

  return renderContent();
};

export default Legal;
